import React, { Component} from 'react';
import  InputRange  from './InputSlider';


class noValueSlider extends Component {
    constructor(props) {
        super(props)
        this.state = {
            value: [
                {
                value: 0
                },
                {
                value2: 50
                },
                {
                value3: 100
                }
            ]
        }
    }
    render() {
        return (
            <form className="form"> 
            {this.state.value.map((data, i) =>  
                <>

                <InputRange min={0} max={100} value={data.value2} />

                <InputRange min={0} max={100} value={data.value3} />
                </>
            )}
            </form>
        );
    }
}


export default noValueSlider;
